(983, 3, '2020-03-01 08:35:08', '2020-03-01 11:35:08', '<audio class="audio-for-speech"></audio>\r\n<div class="translate-tooltip-mtz hidden">\r\n<div class="header">\r\n<div class="header-controls"></div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<h3>1 - Da participação nos Sorteios</h3>\r\nToda e qualquer pessoa maior de 16 anos pode participar de ações disponíveis.\r\n<h3></h3>\r\n<h3>2 - Pagamento do Bilhete</h3>\r\nO Pagamento deverá ser efetuado através de transferência via Pix ou depósito.\r\n<h3></h3>\r\n<h3>3 - Adiamento do Sorteio.</h3>\r\nCaso o Sorteio não chegue aos 100% dos bilhetes pagos poderá ser adiado o sorteio até que o mesmo seja completamente vendido.\r\n<h3></h3>\r\n<h3>4 - Sorteio Antecipado.</h3>\r\nCaso o Sorteio chegar aos 100% dos bilhetes vendidos antes da data prazo, automaticamente iremos definir uma nova data de Sorteio antecipada.\r\n<h3></h3>\r\n<h3>5 - Entrega do Prêmio</h3>\r\nApós a extração do resultado no site da Loterias da Caixa. a Alcateia Prêmios, fará a extração conforme o resultado impresso e definirá o ganhador com base nos critérios aqui dispostos. Será denominado (GANHADOR) o resultado formado pelos 3 últimos números das 3 últimas dezenas do resultado impresso no site após a organização do resultado do sorteio, com base nas regras da própria CAIXA. https://loterias.caixa.gov.br (MEGA SENA).\r\n\r\nPara exemplo o resultado da extração CONCURSO 2374 (22/05/2021) - (12) - (13) - (25) - (3<strong>7</strong>) - (3<strong>9</strong>) - (4<strong>1</strong>) - ganhador centena:<strong> (141)</strong> Não havendo em hipótese alguma a possibilidade de ter 2 ganhadores. Se o número sorteado não tiver sido adquirido por nenhum cliente, na próxima extração é liberado novamente o sorteio para os participantes até que seja definido um ganhador. Lembrando caso o sorteio não tenha ganhador definido os números em aberto podem ser adquiridos até a data do sorteio com no mínimo 2 horas de antecedência.\r\n\r\n<img class="alignnone size-medium wp-image-1264" src="http://alcateiapremios.com/wp-content/uploads/2021/06/JJKJ-300x92.png" alt="" width="300" height="92" />\r\n\r\n&nbsp;\r\n<h3>6 - Da definição do ganhador</h3>\r\nO ganhador do sorteio será sempre o participante que tiver seu nome e celular gravados no bilhete premiado. No caso de pagamento em duplicidade, ou seja, em casos raros onde duas pessoas clicam no mesmo bilhete simultaneamente o ganhador do sorteio será o participante que tiver o nome e celular gravados no bilhete no momento do sorteio. O participante que, no caso de compra em duplicidade não tiver o nome gravado no bilhete deverá solicitar reembolso do valor pago pelo bilhete em questão.\r\n<h3></h3>\r\n<h3>7 - Das proibições</h3>\r\nÉ completamente vedado a participação do organizador em sua própria ação.\r\n<h3></h3>\r\n<h3>8 - Das atualizações</h3>\r\nO site pode alterar a qualquer momento estes termos visando melhorar a qualidade do serviço oferecido.\r\n\r\nO site informará a todos os usuários sempre que ocorrer uma alteração nos termos de uso e o usuário deverá aceitar as mudanças para continuar utilizando o site.\r\n\r\n&nbsp;\r\n<h3>9 - Sobre o Sorteio</h3>\r\nAlcateia Prêmios, é um pagamento único, da modalidade filantropia premiavel regulamentada na lei federal n. 13.019/14 art. 84b, 84c, com a Alcateia Prêmios, você irá contribuir para o desenvolvimento e custeio de ações sociais com entidades parceiras.\r\n\r\n&nbsp;', 'Termos de uso', '', 'publish', 'closed', 'closed', '', 'termos-de-uso', '', '', '2021-06-03 21:52:03', '2021-06-04 00:52:03', '', 0, 'http://rifa-me.test.com/?page_id=983', 0, 'page', '', 0),
(992, 3, '2020-03-01 10:10:45', '2020-03-01 13:10:45', '<div class="form-group">\r\n[text* your-name class:form-control class:form-control-lg placeholder "Nome"] \r\n</div>\r\n<div class="form-group">\r\n[email your-email class:form-control class:form-control-lg placeholder "E-mail"]\r\n</div>\r\n<div class="form-group">\r\n[text* your-numbers class:form-control class:form-control-lg placeholder "Separe os número(s) por vírgula"]\r\n</div>\r\n[dynamichidden site-email "GET_SITE_EMAIL"]\r\n[dynamichidden page-title "CF7_get_post_var key=''title''"]\r\n<div class="form-group border rounded p-2">\r\n[file* proof-of-payment class:proof-of-payment class:form-control-file]\r\n</div>\r\n<div class="form-group text-center">\r\n[submit class:btn class:btn-primary class:btn-lg "Enviar Comprovante"]\r\n</div>\n1\n"Comprovante de pagamento"\nEnviado por <[site-email]>\n[site-email]\nDe: [your-name] <[your-email]>\r\n\r\nNome: [your-name]\r\n\r\nEmail: [your-email]\r\n\r\nNúmero(s): [your-numbers]\r\n\r\nRifa: [page-title]\r\n\r\nURL da Rifa: [_post_url]\r\n\r\n-- \r\nEste e-mail foi enviado de um formulário de contato em [_url]\nReply-To: [your-email]\n[proof-of-payment]\n1\n\n\nRifas Online "[your-subject]"\nRifas Online <wordpress@rifa-me.test.com>\n[your-email]\nCorpo da mensagem:\r\n[your-message]\r\n\r\n-- \r\nEste e-mail foi enviado de um formulário de contato em Rifas Online (http://rifa-me.test.com)\nReply-To: conta@wplottery.test.com\n\n\n\nAgradecemos a sua mensagem.\nOcorreu um erro ao tentar enviar sua mensagem. Tente novamente mais tarde.\nUm ou mais campos possuem um erro. Verifique e tente novamente.\nOcorreu um erro ao tentar enviar sua mensagem. Tente novamente mais tarde.\nVocê deve aceitar os termos e condições antes de enviar sua mensagem.\nO campo é obrigatório.\nO campo é muito longo.\nO campo é muito curto.\nO formato de data está incorreto.\nA data é anterior à mais antiga permitida.\nA data é posterior à maior data permitida.\nOcorreu um erro desconhecido ao enviar o arquivo.\nVocê não tem permissão para enviar esse tipo de arquivo.\nO arquivo é muito grande.\nOcorreu um erro ao enviar o arquivo.\nO formato de número é inválido.\nO número é menor do que o mínimo permitido.\nO número é maior do que o máximo permitido.\nA resposta para o quiz está incorreta.\nO endereço de e-mail informado é inválido.\nA URL é inválida.\nO número de telefone é inválido.', 'Envio de comprovante de pagamento', '', 'publish', 'closed', 'closed', '', 'formulario-envio-de-comprovante-de-pagamento', '', '', '2020-05-08 14:51:37', '2020-05-08 17:51:37', '', 0, 'http://rifa-me.test.com/?post_type=wpcf7_contact_form&#038;p=992', 0, 'wpcf7_contact_form', '', 0),
