(1074, 3, '2020-06-03 18:00:56', '2020-06-03 21:00:56', '<h3>Da participação nas rifas</h3>\r\nToda e qualquer pessoa maior de 16 anos pode participar de ações disponíveis.\r\n<h3>Pagamento do Bilhete</h3>\r\nO Pagamento devera ser efetuado através de Transferencia Bancaria, deposito, Boleto ou Cartão de Credito.\r\n<h3>Entrega do Premio</h3>\r\nPara os ganhadores de outras cidades a Rifas Gold garante o pagamento das despesas do ganhador para vir retirar o prêmio, ou a entrega em sua cidade de acordo com o regulamentos de cada sorteio. Em nenhum dos casos não haverá nenhum ônus para o ganhador.\r\n<h3>Adiamento da Rifa.</h3>\r\nCaso a Rifa não tenha mais de 70% dos bilhetes Pagos Pode ser Adiado o sorteio ate que o mesmo seja completamente vendido.\r\n<h3>Da definição do ganhador</h3>\r\nO ganhador do sorteio será sempre o participante que tiver seu nome e celular gravados no bilhete premiado. No caso de pagamento em duplicidade, ou seja, em casos raros onde duas pessoas clicam no mesmo bilhete simultaneamente o ganhador do sorteio será o participante que tiver o nome e celular gravados no bilhete no momento do sorteio. O participante que, no caso de compra em duplicidade não tiver o nome gravado no bilhete deverá solicitar reembolso do valor pago pelo bilhete em questão.\r\n<h3>Das proibições</h3>\r\nÉ completamente vedado a participação do organizador em sua própria ação.\r\n\r\nO site pode alterar a qualquer momento estes termos visando melhorar a qualidade do serviço oferecido.\r\n\r\nO site informará a todos os usuários sempre que ocorrer uma alteração nos termos de uso e o usuário deverá aceitar as mudanças para continuar utilizando o site.', 'Termos de uso', '', 'inherit', 'closed', 'closed', '', '983-revision-v1', '', '', '2020-06-03 18:00:56', '2020-06-03 21:00:56', '', 983, 'http://alcateiapremios.com/?p=1074', 0, 'revision', '', 0),
(1075, 3, '2020-06-03 18:03:25', '2020-06-03 21:03:25', '<h3>Da participação nas rifas</h3>\r\nToda e qualquer pessoa maior de 16 anos pode participar de ações disponíveis.\r\n<h3>Pagamento do Bilhete</h3>\r\nO Pagamento devera ser efetuado através de Transferencia Bancaria, deposito, Boleto ou Cartão de Credito.\r\n<h3>Entrega do Premio</h3>\r\nPara os ganhadores de outras cidades a Rifas Gold garante o pagamento das despesas do ganhador para vir retirar o prêmio, ou a entrega em sua cidade de acordo com o regulamentos de cada sorteio. Em nenhum dos casos não haverá nenhum ônus para o ganhador.\r\n<h3>Adiamento da Rifa.</h3>\r\nCaso a Rifa não tenha mais de 70% dos bilhetes Pagos Pode ser Adiado o sorteio ate que o mesmo seja completamente vendido.\r\n<h3>Da definição do ganhador</h3>\r\nO ganhador do sorteio será sempre o participante que tiver seu nome e celular gravados no bilhete premiado. No caso de pagamento em duplicidade, ou seja, em casos raros onde duas pessoas clicam no mesmo bilhete simultaneamente o ganhador do sorteio será o participante que tiver o nome e celular gravados no bilhete no momento do sorteio. O participante que, no caso de compra em duplicidade não tiver o nome gravado no bilhete deverá solicitar reembolso do valor pago pelo bilhete em questão.\r\n<h3>Das proibições</h3>\r\nÉ completamente vedado a participação do organizador em sua própria ação.\r\n\r\nO site pode alterar a qualquer momento estes termos visando melhorar a qualidade do serviço oferecido.\r\n\r\nO site informará a todos os usuários sempre que ocorrer uma alteração nos termos de uso e o usuário deverá aceitar as mudanças para continuar utilizando o site.', 'Como funciona', '', 'inherit', 'closed', 'closed', '', '1002-revision-v1', '', '', '2020-06-03 18:03:25', '2020-06-03 21:03:25', '', 1002, 'http://alcateiapremios.com/?p=1075', 0, 'revision', '', 0),
