INSERT INTO `wpor_wc_admin_notes` VALUES
(1, 'wc-admin-manage-store-activity-from-home-screen', 'info', 'en_US', 'New! Manage your store activity from the Home screen', 'Start your day knowing the next steps you need to take with your orders, products, and customer feedback.<br /><br />Read more about how to use the activity panels on the Home screen.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-21 04:47:33', NULL, 0, 'plain', '', 0, 'info'),
(2, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Sign up for tips, product updates, and inspiration', 'We''re here for you - get tips, product updates and inspiration straight to your email box', '{}', 'unactioned', 'woocommerce-admin', '2021-02-21 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-21 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(4, 'facebook_pixel_api_2021', 'marketing', 'en_US', 'Improve the performance of your Facebook ads', 'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved performance and measurement of your Facebook ad campaigns.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(5, 'facebook_ec_2021', 'marketing', 'en_US', 'Sync your product catalog with Facebook to help boost sales', 'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(6, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href="https://wordpress.com/support/concierge-support/">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(7, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(8, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(9, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>  – now supporting <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wcpay-subscriptions-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>  – now supporting <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(11, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'Get 50% off transaction fees with WooCommerce Payments', 'Keep more of your hard-earned cash by adding <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20" target="_blank">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking "Install now," you agree to our promotional <a href="https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(12, 'wcpay-subscriptions-2020-12', 'marketing', 'en_US', 'Manage payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(14, 'your-first-product', 'info', 'en_US', 'Your first product', 'That''s huge! You''re well on your way to building a successful online store — now it’s time to think about how you''ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href="https://href.li/?https://woocommerce.com/shipping" target="_blank">WooCommerce Shipping</a>.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(15, 'wc-square-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(16, 'wc-square-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with Square and Apple Pay ', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(17, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'It''s crucial to get your store''s checkout as smooth as possible to avoid losing sales. Let''s take a look at how you can optimize the checkout experience for your shoppers.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(18, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, we''ve put together this short list of the first few things you should customize in WooCommerce.', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(19, 'wc-admin-effortless-payments-by-mollie', 'info', 'en_US', 'Effortless payments by Mollie', 'Offer global and local payment methods, get onboarded in minutes and supported in your language – try it now!', '{}', 'pending', 'woocommerce.com', '2021-02-23 04:47:34', NULL, 0, 'plain', '', 0, 'info'),
(20, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-21 04:47:35', NULL, 0, 'plain', '', 0, 'info'),
(21, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-22 23:35:22', NULL, 0, 'plain', '', 0, 'info'),
(22, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', 'Insight', 'More than 80% of new merchants add the first product and have at least one payment method set up during the first week. We''re here to help your business succeed! Do you find this type of insight useful?', '{}', 'unactioned', 'woocommerce-admin', '2021-02-22 23:35:22', NULL, 0, 'plain', '', 0, 'info'),
(23, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-24 00:26:40', NULL, 0, 'plain', '', 0, 'info'),
(24, 'wc-admin-add-first-product-note', 'email', 'en_US', 'Store setup', 'Nice one, you’ve created a WooCommerce store! Now it’s time to add your first product.<br /><br />There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br /><br /><a href="https://docs.woocommerce.com/document/managing-products/?utm_source=help_panel">Explore our docs</a> for more information, or just get started!', '{"role":"administrator"}', 'sent', 'woocommerce-admin', '2021-02-24 23:32:30', NULL, 0, 'plain', 'http://alcateiapremios.com/wp-content/plugins/woocommerce/packages/woocommerce-admin/images/admin_notes/img-product-light.png', 0, 'info'),
(25, 'wc-admin-adding-and-managing-products', 'info', 'en_US', 'Adding and Managing Products', 'Learn more about how to set up products in WooCommerce through our useful documentation about adding and managing products.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-24 20:32:30', NULL, 0, 'plain', '', 0, 'info');
